package a01_diexp.z02_vo;

public class Pen {
	private String name;
	private String comp;
	public Pen() {
		// TODO Auto-generated constructor stub
	}
	public Pen(String name, String comp) {
		this.name = name;
		this.comp = comp;
	}
	
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getComp() {
		return comp;
	}
	public void setComp(String comp) {
		this.comp = comp;
	}
	
	
}
